import Home from "./Home"

const DataList = () => {
    const dataList = [
        {name: "Udin"},
        {name: "Asep"},
        {name: "Ucok"},
    ]

  return (
    <div>
        <Home data={dataList} />
    </div>
  )
}


export default DataList
